function Item(props){
    const {item}=props
    return(
        <tr className="border-b-2">
            <td className="p-2">{item.name}</td>
            <td className="p-2">{item.symbol}</td>
            <td className="p-2">{'$ '+(item.current_price).toLocaleString('en-US')}</td>
            <td className="p-2">{Number(item.price_change_percentage_24h).toFixed(2).toString()+" %"}</td>
        </tr>
    )
}
export default Item
